class dataset:
    def __init__(self, kod, nazov, od, dimenzie):
        self.kod_datasetu = kod
        self.nazov = nazov
        self.udaje_od_roku = od
        self.dimenzie = dimenzie
        
    def __repr__(self):
        return self.kod_datasetu

def generuj_roky(od):
    vysledok = []
    for i in range(od, date.today().year):
        vysledok.append(i)
    return vysledok

